        public int MinDays(int[] bloomDay, int m, int k)
        {
            var totalFlowers = (long)(m * k);
            if (bloomDay.Length < totalFlowers)
                return -1;

            var min = int.MaxValue;
            var sum = 0L;

            for (var i = 0; i < bloomDay.Length; i++)
            {
                sum += bloomDay[i];
                min = min < bloomDay[i] ? min : bloomDay[i];
            }

            long left = min;
            long right = sum;
            while (left <= right)
            {
                var mid = left + (right - left) / 2;
                if (isPossible(bloomDay, m, k, mid))
                {
                    right = mid - 1;
                }
                else
                {
                    left = mid + 1;
                }
            }
            return (int)left;
        }

        private bool isPossible(int[] bloomDays, int numberOfBouquets, int numberOfFlowers, long maximumBloomDays)
        {
            int totalBouquets = 0;
            int currentTotalFlowers = 0;
            int currentBloomDaysOfFlower = 0;
            for (var i = 0; i < bloomDays.Length; i++)
            {
                if (bloomDays[i] <= maximumBloomDays && currentTotalFlowers < numberOfFlowers)
                {
                    currentTotalFlowers++;
                    //currentBloomDaysOfFlower = bloomDays[i] > currentBloomDaysOfFlower ? bloomDays[i] : currentBloomDaysOfFlower;
                }
                else
                {
                    currentTotalFlowers = 0;
                }

                if (currentTotalFlowers == numberOfFlowers)
                {
                    currentTotalFlowers = 0;
                    totalBouquets++;
                }
            }

            return totalBouquets >= numberOfBouquets;
        }
    }
